import './App.css';
import Ex from './ex';
import Home from './Home';
import {BrowserRouter as Router,Route,Routes} from 'react-router-dom';


function App() {
  return (
    <Router>
    <div className="App">
        <header><h1>Gym Tracker</h1></header>
        <Routes>
          <Route path = '/' element = {<Home/>}>
          </Route>
          <Route path = '/ex' element = {<Ex/>}>

          </Route>
        </Routes>

      </div>
      </Router>


  );
}

export default App;
